import React from 'react'

function CardPlace(props) {
  return (
    <div id='colums-card'>
         <img src={props.img} alt="photo de l'hotêl" />
         <h2><i className='fas fa-close'></i>{props.lieu}</h2>
         <h3>{props.nomHotel}</h3>
         <p>à peine: {props.distance} mètres</p>
         <p style={{float: 'right'}}>A partir de  <span style={{fontStyle: 'italic'}}>{props.prix}</span> AR</p>
    </div>
  )
}

export default CardPlace
